import React,{Component} from "react";

class TeamMember extends Component{
    
    render(){

    return (
        <div className="col-md-4 col-sm-6 ">
            <div className="card">
                <div className="card-header">
                    <img src={this.props.info.img}/>
                </div>

                <div className="card-body" 
                style={{backgroundColor: !(this.props.info.phone) ? 'orange' : 'white' }}>
                    <h2>{this.props.info.Name}</h2>
                    <h5>{this.props.info.position}</h5>
                    <div>{this.props.info.phone}</div>
                    <div>{this.props.info.email}</div>
                    <div>{this.props.info.facebook}</div>
                </div>
            </div>
        </div>
    )
    }
}

export default TeamMember;
